import { Container, Conteudo } from "../../styles/global";

export default function Folgas() {

  return (
    <Container>
      <Menu></Menu>

      <div className="display-flex" >
        <Header>

          <Conteudo>
            <h1>Folgas</h1>
          </Conteudo>
